import { React } from "react";
import { css } from '@emotion/css'
import { MoreHorizontal } from 'react-feather'
import Card from './Card'



function Board() {
    return (
        //board
        <div className={css`min-width: 290px; max-height: 100%; display:flex; flex-direction:column; gap:20px`}>
            <div className={css`d  display: flex; justify-content: space-between; align-items: center;`}>
                <p className={css`font-weight: bold; font-size: 1rem; display: flex; gap: 5px; align-items: center;`}> To Do <span className={css`  color: rgb(145, 145, 145);`}>2</span>
                </p>
                <MoreHorizontal />
            </div>
            <div className={css`background-color: #f8f8f8; display; flex; flex-direction: column; gap:10px; padding: 10px; border-bottom: 10px;`}>
                <Card />
            </div>
        </div>
    )
}

export default Board;
